import React from "react";
import "./loading.css";

function Loading() {
  return (
    <React.Fragment>
      <div className="upp">
        <div className="col-md-12 centrar">
          <h3>Cargando...</h3>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Loading;
